import React from "react";
//import { withRouter } from 'react-router-dom';
import { Nav, Navbar, NavDropdown, Button, Form, FormControl } from 'react-bootstrap'

import "../navigation/navigation.css";

export class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
          </Nav>
        </Navbar.Collapse>
      </Navbar>


      //<div id="navigation" className="navbar navbar-inverse menu-background sht-navbar"></div>
      // <Nav id="navigation" className="navbar navbar-inverse menu-background sht-navbar">
      // </Nav>
    )
  }
}
